INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('02d7853b3341444b9c50c15ca8b002gs', '5bc4b96c894647d3b887ad7b385002gs', '7c97c66b65024832adb5712e94c702gs', '5744880a246345429aa7bec28daa02gs', 'blues', '<b><span style=\'font-size:14px;\'>建议找专业人士寻求心理辅导。</span><span style=\'font-size:14px;\'></span></b>', 1, '重度焦虑', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('0677cd9879f14f3e9232c2de9da902gs', '776314e734cf4bb88972d53d743a02gs', '804bddcf71014774996fb80af36702gs', '31bce069fb354adc91933ec6c7ba02gs', 'psychotherapy', '过敏体质的人因对过敏原敏感，容易产生紧张、焦虑等情绪，因此要在尽量避免过敏原的同时，还应避免紧张情绪。', 0, '是', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('07a38fd220c04e84966f92e13a1902gs', '776314e734cf4bb88972d53d743a02gs', '804bddcf71014774996fb80af36702gs', '31bce069fb354adc91933ec6c7ba02gs', 'dailyLife', '起居要有规律，保持充足的睡眠时间。居室宜通风良好。生活环境中接触的物品如枕头、棉被、床垫、地毯、窗帘、衣橱易附有尘螨，可引起过敏，应经常清洗、日晒。外出也要避免处在花粉及粉刷油漆的空气中，以免刺激而诱发过敏病症。', 0, '是', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('08b23add0501408fbc8aada67e5e02gs', '881b197d3bd94f67b3c8297911db02gs', '4ea6d23186a0409c9d6bcb102c1402gs', '31bce069fb354adc91933ec6c7ba02gs', 'psychotherapy', '遇事宜沉稳，努力克服浮躁情绪。宜欣赏流畅抒情的音乐，如《春江花月夜》等。', 0, '是', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('0d854bc416824eff9de15c9d560102gs', '881b197d3bd94f67b3c8297911db02gs', '4ea6d23186a0409c9d6bcb102c1402gs', '31bce069fb354adc91933ec6c7ba02gs', 'sportsHealth', '宜进行有助于促进气血运行的运动项目，持之以恒。如步行健身法，或者八段锦，在完成整套动作后将“左右开弓似射雕”和“背后七颠百病消”加做1～3遍。避免在封闭环境中进行锻炼。锻炼强度视身体情况而定，不宜进行大强度、大负荷运动，以防意外。', 0, '是', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('10ae411040564570b5dca28bea1102gs', '0c26ee5491af4058ba15cae2605f02gs', '36b32aa4c990437d812035e8ca2802gs', '36b32aa4c990437d812035e8ca2802gs', 'respiteCare', '建议社区居家养老，照护内容为：\r\n 1．每天清扫家居，保持环境清洁；\r\n 2．每天协助被照护者整理床铺，保持衣被清洁；床上用品整洁；\r\n 3. 督促被照护者做好个人卫生；\r\n 4. 准备餐饮；\r\n 5. 提醒被照护者用餐；\r\n 6. 督促被照护者按时服药；\r\n 7.及时了解被照护者的身体变化；\r\n 8.陪同被照护者进行康复娱乐活动；9.协助被照护者洗澡，根据气温高低，每天或隔天一次；10．协助被照护者做好个人卫生（洗脚、洗头、修剪指/趾甲、剃须等）。', NULL, NULL, 1, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('11e9e09da6134222a1070636a82a02gs', '5a7ca2585a2c43fdbc6093c3060502gs', '36b32aa4c990437d812035e8ca2802gs', '36b32aa4c990437d812035e8ca2802gs', 'dietCare', '22222', NULL, NULL, 1, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('16aae2fd1d9d447f90a87cb8de8502gs', '09992208299744deb8e294c041f302gs', '47b54e69ac8e4623a177bffc586302gs', '31bce069fb354adc91933ec6c7ba02gs', 'sportsHealth', '宜做中长跑、游泳、各种球类、武术等强度较大的锻炼。夏季应避免在烈日下长时间活动，在秋高气爽的季节，经常选择爬山登高，更有助于祛除湿热。也可做八段锦，在完成整套动作后将“双手托天理三焦”和“调理脾胃须单举”加做1～3遍，每日1遍。', 0, '是', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('170719ebf40d4358bee641038a4702gs', '5a7ca2585a2c43fdbc6093c3060502gs', '36b32aa4c990437d812035e8ca2802gs', '36b32aa4c990437d812035e8ca2802gs', 'respiteCare', '建议机构养老，照护内容为：\r\n 1．每天清扫家居，保持环境清洁；\r\n 2．每天协助被照护者整理床铺，保持衣被清洁；床上用品整洁；\r\n 3. 督促被照护者做好个人卫生；\r\n 4. 准备餐饮；\r\n 5. 提醒被照护者用餐；\r\n 6. 督促被照护者按时服药；\r\n 7.及时了解被照护者的身体变化；\r\n 8.陪同被照护者进行康复娱乐活动；9.协助被照护者洗澡，根据气温高低，每天或隔天一次；10．协助被照护者做好个人卫生（洗脚、洗头、修剪指/趾甲、剃须等）；11.每天为被照护者清洗水杯、餐具、毛巾、脸盆；便器用完后及时倾倒、清洗，消毒；12. 协助被照护者穿脱衣物，搀扶行走不便的被照顾者如厕，防止摔倒；13.为卧床被照护者做好晨、晚间护理、口腔护理，定时翻身，检查皮肤受压的情况，预防褥疮等并发症发生；14.协助床上大小便，为大小便失禁的被照护者做到勤查看、勤换洗、勤翻身、及时更换衣被，保持被照护者身体及床单位清洁、干燥、无异味；15. 供应饭菜、茶水到被照护者床边；按时协助被照护者进食、饮水、零食、服药，餐后及时为被照护者清洁整理；16. 对易发生坠床意外者由家属提供床栏、座椅加绳托等安全保护具，确保安全，避免发生意外事故；17. 做好心理照护和卫生宣教工作，推轮椅园内散步。', NULL, NULL, 1, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('1b9ff9457302427298ad9fc533a702gs', 'ebb78642021940539f19df89263b02gs', '1e32b906c8c94dbc8e91107a4f9202gs', '9dcf6e13e163440d8cdc633a3bb102gs', 'blues', '<b><span style=\'font-size:14px;\'>建议及时找专业人士进行综合干预。</span></b>', 2, '中度抑郁', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('20a93f15d28441498044c821642102gs', '79a270647e104b5095b5e528bc5e02gs', 'b898c117b6c84bb084732d21c48f02gs', '31bce069fb354adc91933ec6c7ba02gs', 'dietCare', '宜选用具有理气解郁作用的食物，如黄花菜、菊花、玫瑰花、茉莉花、大麦、金橘、柑橘、柚子等。少食收敛酸涩的食物，如石榴、乌梅、青梅、杨梅、草莓、杨桃、酸枣、李子、柠檬、南瓜、泡菜等。', 0, '是', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('22bf035f1a9c4863838847c2919f02gs', 'af0eaed8b9644a57bfbd7192daf902gs', '7c97c66b65024832adb5712e94c702gs', '5744880a246345429aa7bec28daa02gs', 'blues', '<b><span style=\'font-size:14px;\'>可能有一点产前焦虑和抑郁的情绪，不用担心，了解清楚产前产后抑郁，放松心态面对它。</span></b>', 3, '轻度焦虑', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('2373733b69ba49bebbeab89aedd202gs', '183d4c9db16140d89706ccce433502gs', '180dc8603f024c8b9d8f678813db02gs', '31bce069fb354adc91933ec6c7ba02gs', 'meridianHealth', '关元穴、命门穴\r\n关元穴：参考气虚质。\r\n命门：位于腰部，当后正中线上,第2腰椎棘突下凹陷中。\r\n可采用温和灸的方法，可每周进行1次。 关元穴还可采用掌根揉法。每穴2～3分钟，每天1～2次。也可配合摩擦腰肾法温肾助阳。摩擦腰肾法每天1次，每次约10分钟，以摩至皮肤温热为度。', 0, '是', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('28f73ad6691d462783db171e9e7902gs', 'b0640a5ecb7e44cd850f5754994b02gs', '4013e06e83424acc87fe8ac32a2402gs', '31bce069fb354adc91933ec6c7ba02gs', 'sportsHealth', '坚持长期运动锻炼，强度应根据自身的状况循序渐进。不宜在阴雨季节、天气湿冷的气候条件下运动。 \r\n可选择快走、武术以及打羽毛球等，使松弛的肌肉逐渐变得结实、致密。如果体重过重、膝盖受损，可选择游泳。', 0, '是', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('29f0a633603b44fc90d41ed7963a02gs', '79a270647e104b5095b5e528bc5e02gs', 'b898c117b6c84bb084732d21c48f02gs', '31bce069fb354adc91933ec6c7ba02gs', 'dailyLife', '尽量增加户外活动和社交，防止一人独处时心生凄凉。居室保持安静，宜宽敞、明亮。平日保持有规律的睡眠，睡前避免饮用茶、咖啡和可可等饮料。衣着宜柔软、透气、舒适。', 0, '是', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('2fed01fcff2e41218e274fd9f74c02gs', 'cc67b0f453fe42aa8a9313ada4c602gs', '36b32aa4c990437d812035e8ca2802gs', '36b32aa4c990437d812035e8ca2802gs', 'psychotherapy', '保持良好心态！保持', NULL, NULL, 1, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('30376b1c2f91466895e5af9c297802gs', 'b0640a5ecb7e44cd850f5754994b02gs', '4013e06e83424acc87fe8ac32a2402gs', '31bce069fb354adc91933ec6c7ba02gs', 'dailyLife', '居住环境宜干燥，不宜潮湿，穿衣面料以棉、麻、丝等透气散湿的天然纤维为佳，尽量保持宽松，有利于汗液蒸发，祛除体内湿气。 \r\n晚上睡觉枕头不宜过高，防止打鼾加重；早睡早起，不要过于安逸，贪恋沙发和床榻。', 0, '是', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('38ac349033e84d6cb705e9dae7f202gs', '09992208299744deb8e294c041f302gs', '47b54e69ac8e4623a177bffc586302gs', '31bce069fb354adc91933ec6c7ba02gs', 'dietPrescription', '① 绿豆薏米粥：生薏苡仁40克，绿豆40克。浸泡一夜，放入锅内，加适量水，用文火炖至熟，焖数分钟即可。具有清热利湿解毒的功效，适合湿热体质易长疮疖者食用。 \r\n② 老黄瓜赤小豆煲猪肉汤：老黄瓜1000克，赤小豆80克，瘦猪肉少量，陈皮10克，生姜1～2片。赤小豆、陈皮洗净，陈皮刮去瓤，并一起浸泡；老黄瓜洗净，连皮切为厚块状；猪肉洗净，不用刀切。先放陈皮于瓦煲内，加入清水3000毫升（约12碗水量），武火煲沸后再加入老黄瓜、猪肉、生姜，煮沸后改为文火煲约2.5小时，调入适量食盐和生油即可。具有清热利湿、理气和中的功效，适合湿热体质者食用。', 0, '是', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('3b180f8beaf9460a9ec1094fdf5d02gs', '61dbc33fa0e245a397411719d10202gs', '6b19afae44d84d7da834f479f60802gs', '31bce069fb354adc91933ec6c7ba02gs', 'meridianHealth', '气海穴、关元穴  \r\n气海穴：位于下腹部，前正中线上，当脐下1.5寸；\r\n关元穴：位于下腹部，前正中线上，当脐下3寸。\r\n采用掌根揉法，每个穴位按揉2～3分钟，每天操作1～2次。这两个穴位还可以采用艾条温和灸，增加温养益气的作用。温和灸可每周操作1次。', 0, '是', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('3bfbfb18d8834674a98b7b0356c802gs', 'b0640a5ecb7e44cd850f5754994b02gs', '4013e06e83424acc87fe8ac32a2402gs', '31bce069fb354adc91933ec6c7ba02gs', 'dietPrescription', '① 荷叶粥：干荷叶30g，粳米60g。干荷叶揉碎，与粳米同放锅中，共熬成粥。具有祛湿降浊的功效，适合痰湿体质者食用 。\r\n② 冬瓜海带薏米排骨汤：冬瓜1000克，海带100克，薏米30克，猪排骨少量，生姜2～3片。冬瓜连皮洗净，切成块状；薏米、海带洗净，稍浸泡；猪排骨洗净斩为件状；然后与生姜一起放进瓦煲内，加入清水3000毫升（约12碗水量），先用武火煲沸后，改为文火煲约3个小时，加入适量食盐和少许生油便可。具有健脾祛湿、化痰消浊的功效，适合痰湿体质腹部肥满的老年人食用。\r\n', 0, '是', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('4011ed593515463396a420055bda02gs', '3f28ae27a8114d579387544f497d02gs', '5fb2fdf54f6f4c6d980d9007f32a02gs', '31bce069fb354adc91933ec6c7ba02gs', 'dietCare', '宜选用甘凉滋润的食物，如鸭肉、猪瘦肉、百合、黑芝麻、蜂蜜、荸荠、鳖、海蜇、海参、甘蔗、银耳、燕窝等。少食温燥、辛辣、香浓的食物，如羊肉、韭菜、茴香、辣椒、葱、蒜、葵花子、酒、咖啡、浓茶，以及荔枝、龙眼、樱桃、杏、大枣、核桃、栗子等。', 0, '是', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('4020f7f1e090444585e545649f8b02gs', '881b197d3bd94f67b3c8297911db02gs', '4ea6d23186a0409c9d6bcb102c1402gs', '31bce069fb354adc91933ec6c7ba02gs', 'dailyLife', '居室宜温暖舒适，不宜在阴暗、寒冷的环境中长期工作和生活。衣着宜宽松，注意保暖，保持大便通畅。不宜贪图安逸，宜在阳光充足的时候进行户外活动。避免长时间打麻将、久坐、看电视等。', 0, '是', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('44dda2e2964a46c895981098042a02gs', '09992208299744deb8e294c041f302gs', '47b54e69ac8e4623a177bffc586302gs', '31bce069fb354adc91933ec6c7ba02gs', 'meridianHealth', '支沟穴、阴陵泉穴\r\n支沟穴：位于前臂背侧，当阳池与肘尖的连线上，腕背横纹上3寸，尺骨与桡骨之间；\r\n阴陵泉穴：位于小腿内侧，当胫骨内侧踝后下凹陷处 ；\r\n可采用指揉或拍打的方法，每穴操作2～3分钟，每天1～2次。阴陵泉还可以选择刮痧。', 0, '是', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('4757aea7e21f4543b74968eb202f02gs', '183d4c9db16140d89706ccce433502gs', '180dc8603f024c8b9d8f678813db02gs', '31bce069fb354adc91933ec6c7ba02gs', 'dietCare', '宜选用甘温补脾阳、温肾阳为主的食物，如羊肉、鸡肉、带鱼、黄鳝、虾、刀豆、韭菜、茴香、核桃、栗子、腰果、松子、红茶、生姜等。少食生冷、苦寒、黏腻食物，如田螺、螃蟹、海带、紫菜、芹菜、苦瓜、冬瓜、西瓜、香蕉、柿子、甘蔗、梨、绿豆、蚕豆、绿茶、冷冻饮料等。即使在盛夏也不要过食寒凉之品。', 0, '是', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('4be4667a59f149c78edd9235fa7002gs', 'd5ceb19e89604332b2d6b8da376502gs', 'bf32cb8f90c948be9fdf5c1281b602gs', '31bce069fb354adc91933ec6c7ba02gs', 'dietPrescription', '① 春 宜多食蔬菜，如菠菜、芹菜、春笋、荠菜等。\r\n② 夏 宜多食新鲜水果，如西瓜、番茄、菠萝等，其他清凉生津食品，如金银花、菊花、鲜芦根、绿豆、冬瓜、苦瓜、黄瓜、生菜、豆芽等均可酌情食用，以清热祛暑。\r\n③长夏 宜选用茯苓、藿香、山药、莲子、薏苡仁、扁豆、丝瓜等利湿健脾之品，不宜进食滋腻碍胃的食物。\r\n④秋 宜选用寒温偏性不明显的平性药食。同时，宜食用濡润滋阴之品以保护阴津，如沙参、麦冬、阿胶、甘草等。\r\n⑤冬 宜选用温补之品，如生姜、肉桂、羊肉等温补之品。', 0, '是', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('5172f158df5347ceae03c483cc8c02gs', 'd5ceb19e89604332b2d6b8da376502gs', 'bf32cb8f90c948be9fdf5c1281b602gs', '31bce069fb354adc91933ec6c7ba02gs', 'meridianHealth', '涌泉穴、足三里穴  \r\n涌泉穴：位于足底部，卷足时足前部凹陷处，约当足底2、3趾趾缝纹头端与足跟连线的前三分之一与后三分之二交点上 。\r\n足三里穴：足三里位于小腿前外侧，当犊鼻下3寸，距胫骨前缘一横指处 。\r\n用大拇指或中指指腹按压穴位，做轻柔缓和的环旋活动，以穴位感到酸胀为度，按揉2～3分钟。每天操作1～2次。', 0, '是', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('55c6bcba375a4b17be30efb1fb5f02gs', 'b0640a5ecb7e44cd850f5754994b02gs', '4013e06e83424acc87fe8ac32a2402gs', '31bce069fb354adc91933ec6c7ba02gs', 'dietCare', '宜选用健脾助运、祛湿化痰的食物，如冬瓜、白萝卜、薏苡仁、赤小豆、荷叶、山楂、生姜、荠菜、紫菜、海带、鲫鱼、鲤鱼、鲈鱼、文蛤等。少食肥、甜、油、黏（腻）的食物。', 0, '是', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('5a455ea25e6247018cb6d86bc2e802gs', 'b0640a5ecb7e44cd850f5754994b02gs', '4013e06e83424acc87fe8ac32a2402gs', '31bce069fb354adc91933ec6c7ba02gs', 'meridianHealth', '足三里穴、丰隆穴\r\n足三里穴：位置见气虚质；\r\n丰隆穴：位于小腿前外侧，当外踝尖上8寸，条口外，距胫骨前缘二横指处 ；\r\n可采用指揉法，每穴按揉2～3分钟。每天操作1～2次。\r\n', 0, '是', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('631a3ecbadcd451db176617065c202gs', 'b0640a5ecb7e44cd850f5754994b02gs', '4013e06e83424acc87fe8ac32a2402gs', '31bce069fb354adc91933ec6c7ba02gs', 'psychotherapy', '宜多参加社会活动，培养广泛的兴趣爱好。宜欣赏激进、振奋的音乐，如二胡《赛马》等。', 0, '是', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('658dae97f4af4888899da843f52702gs', '3f28ae27a8114d579387544f497d02gs', '5fb2fdf54f6f4c6d980d9007f32a02gs', '31bce069fb354adc91933ec6c7ba02gs', 'psychotherapy', '宜加强自我修养、培养自己的耐性，尽量减少与人争执、动怒，不宜参加竞争胜负的活动，可在安静、优雅环境中练习书法、绘画等。有条件者可以选择在环境清新凉爽的海边、山林旅游休假。宜欣赏曲调轻柔、舒缓的音乐，如舒伯特《小夜曲》等。', 0, '是', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('66c6480dd1a848f3b352094eab3702gs', '79a270647e104b5095b5e528bc5e02gs', 'b898c117b6c84bb084732d21c48f02gs', '31bce069fb354adc91933ec6c7ba02gs', 'dietPrescription', '① 三花茶：茉莉花、菊花、玫瑰花各3克。沸水冲泡，代茶饮。具有行气解郁功效，适合气郁体质者饮用。 \r\n② 黄花菜瘦肉汤：鲜黄花菜60克(干品20克)，猪瘦肉500克（切块），生姜3片，适量油盐。黄花菜需要先用开水焯一下，放少许油略炒，然后将黄花菜和瘦肉一起放进瓦煲内，加入清水2500毫升，武火煲沸后改文火煲3个小时，调入适量盐、油便可。具有疏肝解郁功效，适合气郁体质者食用。', 0, '是', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('6a2c49883d834b44a664a1922fde02gs', 'f0877357ff01424d8472c4f57f6602gs', '7c97c66b65024832adb5712e94c702gs', '5744880a246345429aa7bec28daa02gs', 'blues', '<b><span style=\'font-size:14px;\'>状态不错，但也要注意预防产前产后抑郁的发生。</span></b>', 4, '无焦虑', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('7714e29fe3f74154851936cfdbbc02gs', '3f28ae27a8114d579387544f497d02gs', '5fb2fdf54f6f4c6d980d9007f32a02gs', '31bce069fb354adc91933ec6c7ba02gs', 'dailyLife', '居住环境宜安静，睡好“子午觉”。避免熬夜及在高温酷暑下工作，不宜洗桑拿、泡温泉。节制房事，勿吸烟。注意防晒，保持皮肤湿润，宜选择选择蚕丝等清凉柔和的衣物 。', 0, '是', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('77d29c9aae66495a8d28264a597902gs', '79a270647e104b5095b5e528bc5e02gs', 'b898c117b6c84bb084732d21c48f02gs', '31bce069fb354adc91933ec6c7ba02gs', 'meridianHealth', '合谷穴、太冲穴\r\n合谷穴：位于手背，第1、2掌骨间，当第2掌骨桡侧的中点处 ；\r\n太冲穴：位于足背侧，当第1跖骨间隙的后方凹陷处。\r\n可采用按揉的方法。每穴操作每穴2～3分钟，每天1～2次。', 0, '是', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('79ad34682e5344368555146a8aa502gs', 'f3af315a5d92464d9630b311eaf702gs', '58d82bd32a0d4955ac609dcf21cd02gs', '8b9bc1a47f3b47e198b7250b93c902gs', 'blues', '<span style=\'font-size:14px;\'><b>可能有一点产前焦虑和抑郁的情绪，不用担心，了解清楚产前产后抑郁，放松心态面对它。</b></span>', 2, '抑郁可疑', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('79c63c0ecf214fb08461770e8f3f02gs', 'e59d949ddf374cf89afef252f3f702gs', '36b32aa4c990437d812035e8ca2802gs', '36b32aa4c990437d812035e8ca2802gs', 'respiteCare', '建议机构养老，照护内容为：\r\n 1．每天清扫家居，保持环境清洁；\r\n 2．每天协助被照护者整理床铺，保持衣被清洁；床上用品整洁；\r\n 3. 督促被照护者做好个人卫生；\r\n 4. 准备餐饮；\r\n 5. 提醒被照护者用餐；\r\n 6. 督促被照护者按时服药；\r\n 7.及时了解被照护者的身体变化；\r\n 8.陪同被照护者进行康复娱乐活动；9.协助被照护者洗澡，根据气温高低，每天或隔天一次；10．协助被照护者做好个人卫生（洗脚、洗头、修剪指/趾甲、剃须等）；11.每天为被照护者清洗水杯、餐具、毛巾、脸盆；便器用完后及时倾倒、清洗，消毒；12. 协助被照护者穿脱衣物，搀扶行走不便的被照顾者如厕，防止摔倒。', NULL, NULL, 1, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('7c272210d9f14d6f9e76b85f18ef02gs', '3f28ae27a8114d579387544f497d02gs', '5fb2fdf54f6f4c6d980d9007f32a02gs', '31bce069fb354adc91933ec6c7ba02gs', 'meridianHealth', '太溪穴、三阴交穴\r\n太溪穴：太溪位于足内侧，内踝后方，当内踝尖与跟腱之间的凹陷处 ；\r\n三阴交穴：位于小腿内侧，当足内踝尖上3寸，胫骨内侧缘后方 ；\r\n可采用指揉的方法，每个穴位按揉2～3分钟，每天操作1～2次。', 0, '是', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('7c8cdc60da6048a8a343a334590302gs', '183d4c9db16140d89706ccce433502gs', '180dc8603f024c8b9d8f678813db02gs', '31bce069fb354adc91933ec6c7ba02gs', 'dailyLife', '居住环境以温和的暖色调为宜，不宜在阴暗潮湿寒冷的环境下长期工作和生活。平时要注意腰部、背部和下肢保暖。白天保持一定活动量，避免打盹瞌睡。睡觉前尽量不要饮水，睡前将小便排净。', 0, '是', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('8132fd829c014f3c9aa661d41d2302gs', '2d38b842098441c084a5b63a785e02gs', '58d82bd32a0d4955ac609dcf21cd02gs', '8b9bc1a47f3b47e198b7250b93c902gs', 'blues', '<b><span style=\'font-size:14px;\'>状态不错，但也要注意预防产前产后抑郁的发生。</span></b><span style=\'font-size:14px;\'></span>', 3, '无抑郁症状', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('864ace06438f407f89d941efc01102gs', '203e48ee760e44cdba68eeb1eaf102gs', '1e32b906c8c94dbc8e91107a4f9202gs', '9dcf6e13e163440d8cdc633a3bb102gs', 'blues', '<b><span style=\'font-size:14px;\'>状态不错，但也要注意预防产前产后抑郁的发生。</span></b>', 4, '无抑郁', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('892addd03b85464c8cf6094d7b0c02gs', '79a270647e104b5095b5e528bc5e02gs', 'b898c117b6c84bb084732d21c48f02gs', '31bce069fb354adc91933ec6c7ba02gs', 'psychotherapy', '宜乐观开朗，多与他人相处，不苛求自己也不苛求他人。如心境抑郁不能排解时，要积极寻找原因，及时向朋友倾诉。宜欣赏节奏欢快、旋律优美的乐曲如《金蛇狂舞》等，还适宜看喜剧、励志剧，以及轻松愉悦的相声表演。', 0, '是', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('8a1989ce17684b35b46312214b1e02gs', 'd5ceb19e89604332b2d6b8da376502gs', 'bf32cb8f90c948be9fdf5c1281b602gs', '31bce069fb354adc91933ec6c7ba02gs', 'sportsHealth', '形成良好的运动健身习惯，可根据个人爱好和耐受程度，选择适合的运动健身项目。', 0, '是', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('8bfc39f6089b4a269f17b44baa2802gs', '61dbc33fa0e245a397411719d10202gs', '6b19afae44d84d7da834f479f60802gs', '31bce069fb354adc91933ec6c7ba02gs', 'dietCare', '宜选用性平偏温、健脾益气的食物，如大米、小米、南瓜、胡萝卜、山药、大枣、香菇、莲子、白扁豆、黄豆、豆腐、鸡肉、鸡蛋、鹌鹑（蛋）、牛肉等。尽量少吃或不吃空心菜、槟榔、生萝卜等耗气的食物。不宜多食生冷苦寒、辛辣燥热的食物。宜选用性平偏温、健脾益气的食物，如大米、小米、南瓜、胡萝卜、山药、大枣、香菇、莲子、白扁豆、黄豆、豆腐、鸡肉、鸡蛋、鹌鹑（蛋）、牛肉等。尽量少吃或不吃空心菜、槟榔、生萝卜等耗气的食物。不宜多食生冷苦寒、辛辣燥热的食物。', 0, '是', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('8c9c310a149a4ff4b9e48b0adca302gs', '61dbc33fa0e245a397411719d10202gs', '6b19afae44d84d7da834f479f60802gs', '31bce069fb354adc91933ec6c7ba02gs', 'dietPrescription', '① 山药粥：山药30g，粳米180g。将山药和粳米一起入锅加清水适量煮粥，煮熟即成。此粥可在每日晚饭时食用。具有补中益气功效，适合气虚体质者食用。\r\n② 黄芪童子鸡：童子鸡1只，生黄芪9g。洗净童子鸡，用纱布袋包好生黄芪，取一根细线，一端扎紧纱布袋口，置于锅内，另一端则绑在锅柄上。在锅中加姜、葱及适量水煮汤，待童子鸡煮熟后，拿出黄芪包。加入盐、黄酒调味，即可食用。具有益气补虚功效，适合气虚体质易自汗者食用。本方补气力量较强，对气虚表现比较明显者，可每隔半个月食用一次，不宜长期连续服用。', 0, '是', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('8e59baf1929f44b3b50ea2c4de4b02gs', '183d4c9db16140d89706ccce433502gs', '180dc8603f024c8b9d8f678813db02gs', '31bce069fb354adc91933ec6c7ba02gs', 'sportsHealth', '宜在阳光充足的环境下适当进行舒缓柔和的户外活动，尽量避免在大风、大寒、大雪的环境中锻炼。\r\n日光浴、空气浴是较好的强身壮阳之法。也可选择八段锦，在完成整套动作后将“五劳七伤往后瞧”和“两手攀足固肾腰”加做1～3遍。', 0, '是', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('9033050490444d49965725ffe3bc02gs', '61dbc33fa0e245a397411719d10202gs', '6b19afae44d84d7da834f479f60802gs', '31bce069fb354adc91933ec6c7ba02gs', 'psychotherapy', '宜保持稳定乐观的心态，不可过度劳神。宜欣赏节奏明快的音乐，如笛子曲《喜相逢》等。', 0, '是', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('97152a863f6b442d8d6b56b9b43002gs', '09992208299744deb8e294c041f302gs', '47b54e69ac8e4623a177bffc586302gs', '31bce069fb354adc91933ec6c7ba02gs', 'psychotherapy', '宜稳定情绪，尽量避免烦恼，可选择不同形式的兴趣爱好。宜欣赏曲调悠扬的乐曲，如古筝《高山流水》等。', 0, '是', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('9bca6b09eb8345b2b3b731ad4af902gs', '1a681a121ae345dba1164d1f453302gs', '36b32aa4c990437d812035e8ca2802gs', '36b32aa4c990437d812035e8ca2802gs', 'respiteCare', '建议社区居家养老，照护内容为：\r\n1．每天清扫家居，保持环境清洁；\r\n2．每天协助被照护者整理床铺，保持衣被清洁；床上用品整洁；\r\n3. 督促被照护者做好个人卫生；\r\n4. 准备餐饮；\r\n5. 提醒被照护者用餐；\r\n6. 督促被照护者按时服药；\r\n7.及时了解被照护者的身体变化；\r\n8.陪同被照护者进行康复娱乐活动。', NULL, NULL, 1, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('9e681622820143608d913bbe64d602gs', '2d7b8983af1d4b6487801fb8e3a702gs', '58d82bd32a0d4955ac609dcf21cd02gs', '8b9bc1a47f3b47e198b7250b93c902gs', 'blues', '<b>建议及时找专业人士进行综合干预。</b><span style=\'font-size:14px;\'></span>', 1, '产后抑郁症', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('a007e5e71f3d49ada58dc352a6a402gs', 'd5ceb19e89604332b2d6b8da376502gs', 'bf32cb8f90c948be9fdf5c1281b602gs', '31bce069fb354adc91933ec6c7ba02gs', 'psychotherapy', '在日常生活中保持平和的心态。可根据个人爱好，选择弹琴、下棋、书法、绘画、听音乐、阅读、旅游、种植花草等放松心情。', 0, '是', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('a2c3afd8617b41209cc966db46e302gs', '881b197d3bd94f67b3c8297911db02gs', '4ea6d23186a0409c9d6bcb102c1402gs', '31bce069fb354adc91933ec6c7ba02gs', 'meridianHealth', '期门穴、血海穴\r\n期门穴：位于胸部，当乳头直下，第6肋间隙，前正中线旁开4寸 ；\r\n血海穴：屈膝，在大腿内侧，髌底内侧端上2寸，当股四头肌内侧头的隆起处 ；\r\n采用指揉法。每个穴位操作2～3分钟，每天操作1～2次。', 0, '是', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('a5a8a236bc8c453390dbec5d8efd02gs', '61dbc33fa0e245a397411719d10202gs', '6b19afae44d84d7da834f479f60802gs', '31bce069fb354adc91933ec6c7ba02gs', 'dailyLife', '提倡劳逸结合，不要过于劳作，以免损伤正气。平时应避免汗出受风。居室环境应采用明亮的暖色调。', 0, '是', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('a7cd03993691465783f96fa2dfad02gs', '881b197d3bd94f67b3c8297911db02gs', '4ea6d23186a0409c9d6bcb102c1402gs', '31bce069fb354adc91933ec6c7ba02gs', 'dietCare', '宜选用具有调畅气血作用的食物，如生山楂、醋、玫瑰花、桃仁（花）、黑豆、油菜等。少食收涩、寒凉、冰冻之物，如乌梅、柿子、石榴、苦瓜、花生米，以及高脂肪、高胆固醇、油腻食物，如蛋黄、虾、猪头肉、猪脑、奶酪等。还可少量饮用葡萄酒、糯米甜酒，有助于促进血液运行，但高血压和冠心病等患者不宜饮用。女性月经期间慎用活血类食物。', 0, '是', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('b6fbfb1ed8f94c91ba8425275ad602gs', '776314e734cf4bb88972d53d743a02gs', '804bddcf71014774996fb80af36702gs', '31bce069fb354adc91933ec6c7ba02gs', 'sportsHealth', '宜进行慢跑、散步等户外活动，也可选择下棋、瑜珈等室内活动。不宜选择大运动量的活动，避免春天或季节交替时长时间在野外锻炼。运动时注意避风寒，如出现哮喘、憋闷的现象应及时停止运动。', 0, '是', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('b837645c09b44f1fb7502c0dd45502gs', 'fa26b1d5b60846ec9a6a8e1502fc02gs', '1e32b906c8c94dbc8e91107a4f9202gs', '9dcf6e13e163440d8cdc633a3bb102gs', 'blues', '<b><span style=\'font-size:14px;\'>可能有一点产前焦虑和抑郁的情绪，不用担心，了解清楚产前产后抑郁，放松心态面对它。</span></b>', 3, '轻度抑郁', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('bf0881e0253945bfb822d2c7154302gs', 'd5ceb19e89604332b2d6b8da376502gs', 'bf32cb8f90c948be9fdf5c1281b602gs', '31bce069fb354adc91933ec6c7ba02gs', 'dietCare', '不要过饥过饱，也不要进食过冷过烫或不干净食物；粗细粮食宜合理搭配，多吃五谷杂粮、蔬菜瓜果，少食过于油腻及辛辣食品；注意戒烟限酒。', 0, '是', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('c0afcbbb9090406aa7fe033935c402gs', '881b197d3bd94f67b3c8297911db02gs', '4ea6d23186a0409c9d6bcb102c1402gs', '31bce069fb354adc91933ec6c7ba02gs', 'dietPrescription', '①黑豆川芎粥：川芎10g，黑豆25g，粳米50g。川芎用纱布包裹，和黑豆、粳米一起水煎煮熟，加适量红糖，分次温服。具有活血祛瘀功效，适合血瘀体质者食用。 \r\n②红花三七蒸老母鸡：老母鸡1只（约1000g），参三七10g，红花15g，陈皮10g。将老母鸡宰杀，剖腹去内脏，洗净后，放入三七、红花、陈皮，文火蒸熟，至肉烂，加葱、盐、姜调味，分餐食之。具有活血行气功效，适合血瘀体质患有胸痹、痛证者食用。', 0, '是', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('c1aa7db5eb9b44a9b4363597005602gs', '183d4c9db16140d89706ccce433502gs', '180dc8603f024c8b9d8f678813db02gs', '31bce069fb354adc91933ec6c7ba02gs', 'psychotherapy', '宜保持积极向上的心态，正确对待生活中的不利事件，及时调节自己的消极情绪。 宜欣赏激昂、高亢、豪迈的音乐，如《黄河大合唱》等。', 0, '是', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('c34e7575091346fe91894637668702gs', '776314e734cf4bb88972d53d743a02gs', '804bddcf71014774996fb80af36702gs', '31bce069fb354adc91933ec6c7ba02gs', 'dietCare', '饮食宜均衡、粗细搭配适当、荤素配伍合理，宜多食益气固表的食物，尽量少食辛辣、腥发食物，不食含致敏物质的食品，如蚕豆、白扁豆、羊肉、鹅肉、鲤鱼、虾、蟹、茄子、辣椒、浓茶、咖啡等。', 0, '是', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('c3d4ba9e7bbd4a74b4233a2bf5ba02gs', '09992208299744deb8e294c041f302gs', '47b54e69ac8e4623a177bffc586302gs', '31bce069fb354adc91933ec6c7ba02gs', 'dailyLife', '居室宜干燥、通风良好，避免居处潮热，可在室内用除湿器或空调改善湿、热的环境。选择款式宽松，透气性好的天然棉、麻、丝质服装。注意个人卫生，预防皮肤病变。\r\n保持充足而有规律的睡眠，睡前半小时不宜思考问题、看书、看情节紧张的电视节目，避免服用兴奋饮料，不宜吸烟饮酒。保持二便通畅，防止湿热积聚。', 0, '是', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('c589f331f7184a6883c9d1e0333302gs', 'e3991a7660b4448492abebf8a90e02gs', '7c97c66b65024832adb5712e94c702gs', '5744880a246345429aa7bec28daa02gs', 'blues', '<b><span style=\'font-size:14px;\'>建议找专业人士寻求心理辅导。</span></b>', 2, '中度焦虑', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('c665d0e9dcd0403e974c1b31d8a502gs', '79a270647e104b5095b5e528bc5e02gs', 'b898c117b6c84bb084732d21c48f02gs', '31bce069fb354adc91933ec6c7ba02gs', 'sportsHealth', '宜多参加群体性体育运动项目，坚持做较大强度、较大负荷的“发泄式”锻炼，如跑步、登山、游泳。也可参与下棋、打牌等娱乐活动，分散注意力。', 0, '是', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('c713ef5fb7fe474e926cea1c735402gs', 'b28df944979c4460bcc7ba98c98d02gs', '1e32b906c8c94dbc8e91107a4f9202gs', '9dcf6e13e163440d8cdc633a3bb102gs', 'blues', '<b><span style=\'font-size:14px;\'>建议及时找专业人士进行综合干预。</span></b>', 1, '重度抑郁', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('c9e12c4d8c17471ea6a216d62bad02gs', '776314e734cf4bb88972d53d743a02gs', '804bddcf71014774996fb80af36702gs', '31bce069fb354adc91933ec6c7ba02gs', 'meridianHealth', '神阙穴、曲池穴\r\n神阙穴：位于腹中部，脐中央；\r\n曲池穴：位于肘横纹外侧端，屈肘，当尺泽与在肘横纹外侧端与肱骨外上髁连线中点 ；\r\n神阙采用温和灸，每周1次。曲池采用指揉法，按揉2～3分钟。每天操作1～2次。', 0, '是', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('ce7ffe313c3644449618a888a91d02gs', '09992208299744deb8e294c041f302gs', '47b54e69ac8e4623a177bffc586302gs', '31bce069fb354adc91933ec6c7ba02gs', 'dietCare', '宜选用甘寒或苦寒的清利化湿食物，如绿豆（芽）、绿豆糕、绿茶、芹菜、黄瓜、苦瓜、西瓜、冬瓜、薏苡仁、赤小豆、马齿苋、藕等。少食羊肉、动物内脏等肥厚油腻之品，以及韭菜、生姜、辣椒、胡椒、花椒及火锅、烹炸、烧烤等辛温助热的食物。', 0, '是', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('e09cc20b9c0842fb8ce51a77d74b02gs', '3f28ae27a8114d579387544f497d02gs', '5fb2fdf54f6f4c6d980d9007f32a02gs', '31bce069fb354adc91933ec6c7ba02gs', 'dietPrescription', '① 蜂蜜银耳蒸百合：百合120g，蜂蜜30g，银耳30g。将百合、蜂蜜、银耳拌和均匀，蒸令熟软。具有养阴生津润燥的功效，适合阴虚体质常感咽干口燥、皮肤干燥者食用。糖尿病患者不宜使用本方。 \r\n② 莲子百合煲瘦肉：莲子（去芯）20g，百合20g，猪瘦肉100g。用莲子（去芯）、百合、猪瘦肉，加水适量同煲，肉熟烂后用盐调味食用。具有养阴清热、益气安神功效，适合阴虚体质常感虚烦失眠多梦者食用 。\r\n', 0, '是', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('e134c16a6d1a4fc485938acfef1702gs', '183d4c9db16140d89706ccce433502gs', '180dc8603f024c8b9d8f678813db02gs', '31bce069fb354adc91933ec6c7ba02gs', 'dietPrescription', '①当归生姜羊肉汤：当归20g，生姜30g，羊肉500g。当归、生姜冲洗干净，用清水浸软，切片备用。羊肉剔去筋膜，放入开水锅中略烫，除去血水后捞出，切片备用。当归、生姜、羊肉放入砂锅中，加清水、料酒、食盐，旺火烧沸后撇去浮沫，再改用小火炖至羊肉熟烂即成。具有温阳补血、祛寒止痛功效，适合阳虚体质者食用 。\r\n②韭菜炒胡桃仁：胡桃仁50g，韭菜200g。生胡桃仁开水浸泡去皮，沥干备用。韭菜摘洗干净，切成寸段备用。麻油倒入炒锅，烧至七成热时，加入胡桃仁，炒黄，再加入韭菜、食盐，翻炒至熟。具有温肾助阳功效，适合阳虚体质腰膝冷痛者。', 0, '是', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('e4333c515e9744dda5e7bc8c0c3802gs', '61dbc33fa0e245a397411719d10202gs', '6b19afae44d84d7da834f479f60802gs', '31bce069fb354adc91933ec6c7ba02gs', 'sportsHealth', '宜选择比较柔和的传统健身项目，如八段锦。在做完全套八段锦动作后，将“两手攀足固肾腰”和“攒拳怒目增力气”各加做1～3遍。避免剧烈运动。\r\n还可采用提肛法防止脏器下垂，提肛法：全身放松，注意力集中在会阴肛门部。首先吸气收腹，收缩并提升肛门，停顿2～3秒之后，再缓慢放松呼气，如此反复10～15次。', 0, '是', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('e661cbe3a59d423aaae13b7eb3f402gs', '3f28ae27a8114d579387544f497d02gs', '5fb2fdf54f6f4c6d980d9007f32a02gs', '31bce069fb354adc91933ec6c7ba02gs', 'sportsHealth', '宜做中小强度的运动项目，控制出汗量，及时补充水分。不宜进行大强度、大运动量的锻炼，避免在炎热的夏天或闷热的环境中运动。\r\n可选择八段锦，在做完八段锦整套动作后将“摇头摆尾去心火”和“两手攀足固肾腰”加做1～3遍。也可选择太极拳、太极剑等。', 0, '是', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('eb056e5ff8004571a82933a6f39802gs', 'd5ceb19e89604332b2d6b8da376502gs', 'bf32cb8f90c948be9fdf5c1281b602gs', '31bce069fb354adc91933ec6c7ba02gs', 'dailyLife', '起居宜规律，睡眠要充足，劳逸相结合，穿戴求自然。', 0, '是', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('f54de501bcb448dc893d208e3e8f02gs', '776314e734cf4bb88972d53d743a02gs', '804bddcf71014774996fb80af36702gs', '31bce069fb354adc91933ec6c7ba02gs', 'dietPrescription', '① 固表粥：乌梅15g、黄芪20g、当归12g、粳米100g。乌梅、黄芪、当归放砂锅中加水煎开，再用小火慢煎成浓汁，取出药汁后，再加水煎开后取汁，用汁煮粳米成粥，加冰糖趁热食用。具有益气养血脱敏功效，适合过敏体质易发皮肤过敏者食用。 \r\n② 黄芪首乌藤炖猪瘦肉：首乌藤15克，黄芪15克，猪瘦肉100克，食盐、葱、生姜、料酒、味精各适量。首乌藤、黄芪洗净，切片备用；猪瘦肉洗净，切成2厘米见方的块，放人锅内，加灵芝、黄芪、调料、水适量。锅置武火上烧沸，用文火炖熬至瘦猪肉热烂即成。具有益气养血、祛风脱敏功效，适合过敏体质者食用。', 0, '是', 0, '1', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_assess_guide` (`assess_guide_id`, `qs_standard_id`, `questionnaire_id`, `main_questionnaire_id`, `guide_item_code`, `guide_item_content`, `qss_grade`, `qss_grade_desc`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('f796a541518f46dfb2a1dcf3f21902gs', '5a7ca2585a2c43fdbc6093c3060502gs', '36b32aa4c990437d812035e8ca2802gs', '36b32aa4c990437d812035e8ca2802gs', 'dailyLife', '222', NULL, NULL, 1, '1', '2018-7-6 14:01:28', 2);
