INSERT INTO `t_kb_guide` (`kb_guide_id`, `report_id`, `guide_item_name`, `guide_item_content`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('a9b2e5e081f649afaebc6c5c35fc02gs', 'ad8bbb670dee499c960136786fe402gs', '抑郁评估', '<b>建议及时找专业人士进行综合干预。</b><span style=\'font-size:14px;\'></span>', 0, 'fab4bfb8765b4c248154d3d658c0393a', '2018-7-6 14:01:28', 2);
