INSERT INTO `t_kb_guide` (`kb_guide_id`, `report_id`, `guide_item_name`, `guide_item_content`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('b21c7a6482ac4a62a8f263bcc89d02gs', '35d069d681e342828ff6f6d2778a02gs', '情志调摄', '宜保持稳定乐观的心态，不可过度劳神。宜欣赏节奏明快的音乐，如笛子曲《喜相逢》等。宜保持积极向上的心态，正确对待生活中的不利事件，及时调节自己的消极情绪。 宜欣赏激昂、高亢、豪迈的音乐，如《黄河大合唱》等。宜加强自我修养、培养自己的耐性，尽量减少与人争执、动怒，不宜参加竞争胜负的活动，可在安静、优雅环境中练习书法、绘画等。有条件者可以选择在环境清新凉爽的海边、山林旅游休假。宜欣赏曲调轻柔、舒缓的音乐，如舒伯特《小夜曲》等。宜多参加社会活动，培养广泛的兴趣爱好。宜欣赏激进、振奋的音乐，如二胡《赛马》等。宜稳定情绪，尽量避免烦恼，可选择不同形式的兴趣爱好。宜欣赏曲调悠扬的乐曲，如古筝《高山流水》等。遇事宜沉稳，努力克服浮躁情绪。宜欣赏流畅抒情的音乐，如《春江花月夜》等。宜乐观开朗，多与他人相处，不苛求自己也不苛求他人。如心境抑郁不能排解时，要积极寻找原因，及时向朋友倾诉。宜欣赏节奏欢快、旋律优美的乐曲如《金蛇狂舞》等，还适宜看喜剧、励志剧，以及轻松愉悦的相声表演。过敏体质的人因对过敏原敏感，容易产生紧张、焦虑等情绪，因此要在尽量避免过敏原的同时，还应避免紧张情绪。', 0, 'fab4bfb8765b4c248154d3d658c0393a', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_guide` (`kb_guide_id`, `report_id`, `guide_item_name`, `guide_item_content`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('b8d438065cea4158a0f7b4a0ff9502gs', '1d9a37a1d9da44a1a648b4fa37d702gs', '穴位保健', '气海穴、关元穴  \r\n气海穴：位于下腹部，前正中线上，当脐下1.5寸；\r\n关元穴：位于下腹部，前正中线上，当脐下3寸。\r\n采用掌根揉法，每个穴位按揉2～3分钟，每天操作1～2次。这两个穴位还可以采用艾条温和灸，增加温养益气的作用。温和灸可每周操作1次。关元穴、命门穴\r\n关元穴：参考气虚质。\r\n命门：位于腰部，当后正中线上,第2腰椎棘突下凹陷中。\r\n可采用温和灸的方法，可每周进行1次。 关元穴还可采用掌根揉法。每穴2～3分钟，每天1～2次。也可配合摩擦腰肾法温肾助阳。摩擦腰肾法每天1次，每次约10分钟，以摩至皮肤温热为度。太溪穴、三阴交穴\r\n太溪穴：太溪位于足内侧，内踝后方，当内踝尖与跟腱之间的凹陷处 ；\r\n三阴交穴：位于小腿内侧，当足内踝尖上3寸，胫骨内侧缘后方 ；\r\n可采用指揉的方法，每个穴位按揉2～3分钟，每天操作1～2次。足三里穴、丰隆穴\r\n足三里穴：位置见气虚质；\r\n丰隆穴：位于小腿前外侧，当外踝尖上8寸，条口外，距胫骨前缘二横指处 ；\r\n可采用指揉法，每穴按揉2～3分钟。每天操作1～2次。\r\n支沟穴、阴陵泉穴\r\n支沟穴：位于前臂背侧，当阳池与肘尖的连线上，腕背横纹上3寸，尺骨与桡骨之间；\r\n阴陵泉穴：位于小腿内侧，当胫骨内侧踝后下凹陷处 ；\r\n可采用指揉或拍打的方法，每穴操作2～3分钟，每天1～2次。阴陵泉还可以选择刮痧。期门穴、血海穴\r\n期门穴：位于胸部，当乳头直下，第6肋间隙，前正中线旁开4寸 ；\r\n血海穴：屈膝，在大腿内侧，髌底内侧端上2寸，当股四头肌内侧头的隆起处 ；\r\n采用指揉法。每个穴位操作2～3分钟，每天操作1～2次。合谷穴、太冲穴\r\n合谷穴：位于手背，第1、2掌骨间，当第2掌骨桡侧的中点处 ；\r\n太冲穴：位于足背侧，当第1跖骨间隙的后方凹陷处。\r\n可采用按揉的方法。每穴操作每穴2～3分钟，每天1～2次。神阙穴、曲池穴\r\n神阙穴：位于腹中部，脐中央；\r\n曲池穴：位于肘横纹外侧端，屈肘，当尺泽与在肘横纹外侧端与肱骨外上髁连线中点 ；\r\n神阙采用温和灸，每周1次。曲池采用指揉法，按揉2～3分钟。每天操作1～2次。', 0, 'fab4bfb8765b4c248154d3d658c0393a', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_guide` (`kb_guide_id`, `report_id`, `guide_item_name`, `guide_item_content`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('c94f0e8a97c5476b9401d22280a602gs', '35d069d681e342828ff6f6d2778a02gs', '食疗处方', '① 山药粥：山药30g，粳米180g。将山药和粳米一起入锅加清水适量煮粥，煮熟即成。此粥可在每日晚饭时食用。具有补中益气功效，适合气虚体质者食用。\r\n② 黄芪童子鸡：童子鸡1只，生黄芪9g。洗净童子鸡，用纱布袋包好生黄芪，取一根细线，一端扎紧纱布袋口，置于锅内，另一端则绑在锅柄上。在锅中加姜、葱及适量水煮汤，待童子鸡煮熟后，拿出黄芪包。加入盐、黄酒调味，即可食用。具有益气补虚功效，适合气虚体质易自汗者食用。本方补气力量较强，对气虚表现比较明显者，可每隔半个月食用一次，不宜长期连续服用。①当归生姜羊肉汤：当归20g，生姜30g，羊肉500g。当归、生姜冲洗干净，用清水浸软，切片备用。羊肉剔去筋膜，放入开水锅中略烫，除去血水后捞出，切片备用。当归、生姜、羊肉放入砂锅中，加清水、料酒、食盐，旺火烧沸后撇去浮沫，再改用小火炖至羊肉熟烂即成。具有温阳补血、祛寒止痛功效，适合阳虚体质者食用 。\r\n②韭菜炒胡桃仁：胡桃仁50g，韭菜200g。生胡桃仁开水浸泡去皮，沥干备用。韭菜摘洗干净，切成寸段备用。麻油倒入炒锅，烧至七成热时，加入胡桃仁，炒黄，再加入韭菜、食盐，翻炒至熟。具有温肾助阳功效，适合阳虚体质腰膝冷痛者。① 蜂蜜银耳蒸百合：百合120g，蜂蜜30g，银耳30g。将百合、蜂蜜、银耳拌和均匀，蒸令熟软。具有养阴生津润燥的功效，适合阴虚体质常感咽干口燥、皮肤干燥者食用。糖尿病患者不宜使用本方。 \r\n② 莲子百合煲瘦肉：莲子（去芯）20g，百合20g，猪瘦肉100g。用莲子（去芯）、百合、猪瘦肉，加水适量同煲，肉熟烂后用盐调味食用。具有养阴清热、益气安神功效，适合阴虚体质常感虚烦失眠多梦者食用 。\r\n① 荷叶粥：干荷叶30g，粳米60g。干荷叶揉碎，与粳米同放锅中，共熬成粥。具有祛湿降浊的功效，适合痰湿体质者食用 。\r\n② 冬瓜海带薏米排骨汤：冬瓜1000克，海带100克，薏米30克，猪排骨少量，生姜2～3片。冬瓜连皮洗净，切成块状；薏米、海带洗净，稍浸泡；猪排骨洗净斩为件状；然后与生姜一起放进瓦煲内，加入清水3000毫升（约12碗水量），先用武火煲沸后，改为文火煲约3个小时，加入适量食盐和少许生油便可。具有健脾祛湿、化痰消浊的功效，适合痰湿体质腹部肥满的老年人食用。\r\n① 绿豆薏米粥：生薏苡仁40克，绿豆40克。浸泡一夜，放入锅内，加适量水，用文火炖至熟，焖数分钟即可。具有清热利湿解毒的功效，适合湿热体质易长疮疖者食用。 \r\n② 老黄瓜赤小豆煲猪肉汤：老黄瓜1000克，赤小豆80克，瘦猪肉少量，陈皮10克，生姜1～2片。赤小豆、陈皮洗净，陈皮刮去瓤，并一起浸泡；老黄瓜洗净，连皮切为厚块状；猪肉洗净，不用刀切。先放陈皮于瓦煲内，加入清水3000毫升（约12碗水量），武火煲沸后再加入老黄瓜、猪肉、生姜，煮沸后改为文火煲约2.5小时，调入适量食盐和生油即可。具有清热利湿、理气和中的功效，适合湿热体质者食用。①黑豆川芎粥：川芎10g，黑豆25g，粳米50g。川芎用纱布包裹，和黑豆、粳米一起水煎煮熟，加适量红糖，分次温服。具有活血祛瘀功效，适合血瘀体质者食用。 \r\n②红花三七蒸老母鸡：老母鸡1只（约1000g），参三七10g，红花15g，陈皮10g。将老母鸡宰杀，剖腹去内脏，洗净后，放入三七、红花、陈皮，文火蒸熟，至肉烂，加葱、盐、姜调味，分餐食之。具有活血行气功效，适合血瘀体质患有胸痹、痛证者食用。① 三花茶：茉莉花、菊花、玫瑰花各3克。沸水冲泡，代茶饮。具有行气解郁功效，适合气郁体质者饮用。 \r\n② 黄花菜瘦肉汤：鲜黄花菜60克(干品20克)，猪瘦肉500克（切块），生姜3片，适量油盐。黄花菜需要先用开水焯一下，放少许油略炒，然后将黄花菜和瘦肉一起放进瓦煲内，加入清水2500毫升，武火煲沸后改文火煲3个小时，调入适量盐、油便可。具有疏肝解郁功效，适合气郁体质者食用。① 固表粥：乌梅15g、黄芪20g、当归12g、粳米100g。乌梅、黄芪、当归放砂锅中加水煎开，再用小火慢煎成浓汁，取出药汁后，再加水煎开后取汁，用汁煮粳米成粥，加冰糖趁热食用。具有益气养血脱敏功效，适合过敏体质易发皮肤过敏者食用。 \r\n② 黄芪首乌藤炖猪瘦肉：首乌藤15克，黄芪15克，猪瘦肉100克，食盐、葱、生姜、料酒、味精各适量。首乌藤、黄芪洗净，切片备用；猪瘦肉洗净，切成2厘米见方的块，放人锅内，加灵芝、黄芪、调料、水适量。锅置武火上烧沸，用文火炖熬至瘦猪肉热烂即成。具有益气养血、祛风脱敏功效，适合过敏体质者食用。', 0, 'fab4bfb8765b4c248154d3d658c0393a', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_guide` (`kb_guide_id`, `report_id`, `guide_item_name`, `guide_item_content`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('cb7eca77bda64ff1ad3ac53903e602gs', '729f8e1e33944bdcb1e4d3c5565002gs', '运动保健', '宜选择比较柔和的传统健身项目，如八段锦。在做完全套八段锦动作后，将“两手攀足固肾腰”和“攒拳怒目增力气”各加做1～3遍。避免剧烈运动。\r\n还可采用提肛法防止脏器下垂，提肛法：全身放松，注意力集中在会阴肛门部。首先吸气收腹，收缩并提升肛门，停顿2～3秒之后，再缓慢放松呼气，如此反复10～15次。宜在阳光充足的环境下适当进行舒缓柔和的户外活动，尽量避免在大风、大寒、大雪的环境中锻炼。\r\n日光浴、空气浴是较好的强身壮阳之法。也可选择八段锦，在完成整套动作后将“五劳七伤往后瞧”和“两手攀足固肾腰”加做1～3遍。宜做中小强度的运动项目，控制出汗量，及时补充水分。不宜进行大强度、大运动量的锻炼，避免在炎热的夏天或闷热的环境中运动。\r\n可选择八段锦，在做完八段锦整套动作后将“摇头摆尾去心火”和“两手攀足固肾腰”加做1～3遍。也可选择太极拳、太极剑等。坚持长期运动锻炼，强度应根据自身的状况循序渐进。不宜在阴雨季节、天气湿冷的气候条件下运动。 \r\n可选择快走、武术以及打羽毛球等，使松弛的肌肉逐渐变得结实、致密。如果体重过重、膝盖受损，可选择游泳。宜做中长跑、游泳、各种球类、武术等强度较大的锻炼。夏季应避免在烈日下长时间活动，在秋高气爽的季节，经常选择爬山登高，更有助于祛除湿热。也可做八段锦，在完成整套动作后将“双手托天理三焦”和“调理脾胃须单举”加做1～3遍，每日1遍。宜进行有助于促进气血运行的运动项目，持之以恒。如步行健身法，或者八段锦，在完成整套动作后将“左右开弓似射雕”和“背后七颠百病消”加做1～3遍。避免在封闭环境中进行锻炼。锻炼强度视身体情况而定，不宜进行大强度、大负荷运动，以防意外。宜多参加群体性体育运动项目，坚持做较大强度、较大负荷的“发泄式”锻炼，如跑步、登山、游泳。也可参与下棋、打牌等娱乐活动，分散注意力。宜进行慢跑、散步等户外活动，也可选择下棋、瑜珈等室内活动。不宜选择大运动量的活动，避免春天或季节交替时长时间在野外锻炼。运动时注意避风寒，如出现哮喘、憋闷的现象应及时停止运动。', 0, 'fab4bfb8765b4c248154d3d658c0393a', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_guide` (`kb_guide_id`, `report_id`, `guide_item_name`, `guide_item_content`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('d59f94ac72374c499f314fef931502gs', '35d069d681e342828ff6f6d2778a02gs', '起居调摄', '提倡劳逸结合，不要过于劳作，以免损伤正气。平时应避免汗出受风。居室环境应采用明亮的暖色调。居住环境以温和的暖色调为宜，不宜在阴暗潮湿寒冷的环境下长期工作和生活。平时要注意腰部、背部和下肢保暖。白天保持一定活动量，避免打盹瞌睡。睡觉前尽量不要饮水，睡前将小便排净。居住环境宜安静，睡好“子午觉”。避免熬夜及在高温酷暑下工作，不宜洗桑拿、泡温泉。节制房事，勿吸烟。注意防晒，保持皮肤湿润，宜选择选择蚕丝等清凉柔和的衣物 。居住环境宜干燥，不宜潮湿，穿衣面料以棉、麻、丝等透气散湿的天然纤维为佳，尽量保持宽松，有利于汗液蒸发，祛除体内湿气。 \r\n晚上睡觉枕头不宜过高，防止打鼾加重；早睡早起，不要过于安逸，贪恋沙发和床榻。居室宜干燥、通风良好，避免居处潮热，可在室内用除湿器或空调改善湿、热的环境。选择款式宽松，透气性好的天然棉、麻、丝质服装。注意个人卫生，预防皮肤病变。\r\n保持充足而有规律的睡眠，睡前半小时不宜思考问题、看书、看情节紧张的电视节目，避免服用兴奋饮料，不宜吸烟饮酒。保持二便通畅，防止湿热积聚。居室宜温暖舒适，不宜在阴暗、寒冷的环境中长期工作和生活。衣着宜宽松，注意保暖，保持大便通畅。不宜贪图安逸，宜在阳光充足的时候进行户外活动。避免长时间打麻将、久坐、看电视等。尽量增加户外活动和社交，防止一人独处时心生凄凉。居室保持安静，宜宽敞、明亮。平日保持有规律的睡眠，睡前避免饮用茶、咖啡和可可等饮料。衣着宜柔软、透气、舒适。起居要有规律，保持充足的睡眠时间。居室宜通风良好。生活环境中接触的物品如枕头、棉被、床垫、地毯、窗帘、衣橱易附有尘螨，可引起过敏，应经常清洗、日晒。外出也要避免处在花粉及粉刷油漆的空气中，以免刺激而诱发过敏病症。', 0, 'fab4bfb8765b4c248154d3d658c0393a', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_guide` (`kb_guide_id`, `report_id`, `guide_item_name`, `guide_item_content`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('dccb8f97b20c435ead12077971b29c47', 'a2856ca611a94a45b2847a6be18f7330', '抑郁评估', '<b><span style=\'font-size:14px;\'>可能有一点产前焦虑和抑郁的情绪，不用担心，了解清楚产前产后抑郁，放松心态面对它。</span></b>', 0, 'cc046dd712fa4817a496bf73f0402352', '2018-9-29 10:22:09', 2);
INSERT INTO `t_kb_guide` (`kb_guide_id`, `report_id`, `guide_item_name`, `guide_item_content`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('f0a765c6fc26460c81f4dbde7d7202gs', '729f8e1e33944bdcb1e4d3c5565002gs', '食疗处方', '① 山药粥：山药30g，粳米180g。将山药和粳米一起入锅加清水适量煮粥，煮熟即成。此粥可在每日晚饭时食用。具有补中益气功效，适合气虚体质者食用。\r\n② 黄芪童子鸡：童子鸡1只，生黄芪9g。洗净童子鸡，用纱布袋包好生黄芪，取一根细线，一端扎紧纱布袋口，置于锅内，另一端则绑在锅柄上。在锅中加姜、葱及适量水煮汤，待童子鸡煮熟后，拿出黄芪包。加入盐、黄酒调味，即可食用。具有益气补虚功效，适合气虚体质易自汗者食用。本方补气力量较强，对气虚表现比较明显者，可每隔半个月食用一次，不宜长期连续服用。①当归生姜羊肉汤：当归20g，生姜30g，羊肉500g。当归、生姜冲洗干净，用清水浸软，切片备用。羊肉剔去筋膜，放入开水锅中略烫，除去血水后捞出，切片备用。当归、生姜、羊肉放入砂锅中，加清水、料酒、食盐，旺火烧沸后撇去浮沫，再改用小火炖至羊肉熟烂即成。具有温阳补血、祛寒止痛功效，适合阳虚体质者食用 。\r\n②韭菜炒胡桃仁：胡桃仁50g，韭菜200g。生胡桃仁开水浸泡去皮，沥干备用。韭菜摘洗干净，切成寸段备用。麻油倒入炒锅，烧至七成热时，加入胡桃仁，炒黄，再加入韭菜、食盐，翻炒至熟。具有温肾助阳功效，适合阳虚体质腰膝冷痛者。① 蜂蜜银耳蒸百合：百合120g，蜂蜜30g，银耳30g。将百合、蜂蜜、银耳拌和均匀，蒸令熟软。具有养阴生津润燥的功效，适合阴虚体质常感咽干口燥、皮肤干燥者食用。糖尿病患者不宜使用本方。 \r\n② 莲子百合煲瘦肉：莲子（去芯）20g，百合20g，猪瘦肉100g。用莲子（去芯）、百合、猪瘦肉，加水适量同煲，肉熟烂后用盐调味食用。具有养阴清热、益气安神功效，适合阴虚体质常感虚烦失眠多梦者食用 。\r\n① 荷叶粥：干荷叶30g，粳米60g。干荷叶揉碎，与粳米同放锅中，共熬成粥。具有祛湿降浊的功效，适合痰湿体质者食用 。\r\n② 冬瓜海带薏米排骨汤：冬瓜1000克，海带100克，薏米30克，猪排骨少量，生姜2～3片。冬瓜连皮洗净，切成块状；薏米、海带洗净，稍浸泡；猪排骨洗净斩为件状；然后与生姜一起放进瓦煲内，加入清水3000毫升（约12碗水量），先用武火煲沸后，改为文火煲约3个小时，加入适量食盐和少许生油便可。具有健脾祛湿、化痰消浊的功效，适合痰湿体质腹部肥满的老年人食用。\r\n① 绿豆薏米粥：生薏苡仁40克，绿豆40克。浸泡一夜，放入锅内，加适量水，用文火炖至熟，焖数分钟即可。具有清热利湿解毒的功效，适合湿热体质易长疮疖者食用。 \r\n② 老黄瓜赤小豆煲猪肉汤：老黄瓜1000克，赤小豆80克，瘦猪肉少量，陈皮10克，生姜1～2片。赤小豆、陈皮洗净，陈皮刮去瓤，并一起浸泡；老黄瓜洗净，连皮切为厚块状；猪肉洗净，不用刀切。先放陈皮于瓦煲内，加入清水3000毫升（约12碗水量），武火煲沸后再加入老黄瓜、猪肉、生姜，煮沸后改为文火煲约2.5小时，调入适量食盐和生油即可。具有清热利湿、理气和中的功效，适合湿热体质者食用。①黑豆川芎粥：川芎10g，黑豆25g，粳米50g。川芎用纱布包裹，和黑豆、粳米一起水煎煮熟，加适量红糖，分次温服。具有活血祛瘀功效，适合血瘀体质者食用。 \r\n②红花三七蒸老母鸡：老母鸡1只（约1000g），参三七10g，红花15g，陈皮10g。将老母鸡宰杀，剖腹去内脏，洗净后，放入三七、红花、陈皮，文火蒸熟，至肉烂，加葱、盐、姜调味，分餐食之。具有活血行气功效，适合血瘀体质患有胸痹、痛证者食用。① 三花茶：茉莉花、菊花、玫瑰花各3克。沸水冲泡，代茶饮。具有行气解郁功效，适合气郁体质者饮用。 \r\n② 黄花菜瘦肉汤：鲜黄花菜60克(干品20克)，猪瘦肉500克（切块），生姜3片，适量油盐。黄花菜需要先用开水焯一下，放少许油略炒，然后将黄花菜和瘦肉一起放进瓦煲内，加入清水2500毫升，武火煲沸后改文火煲3个小时，调入适量盐、油便可。具有疏肝解郁功效，适合气郁体质者食用。① 固表粥：乌梅15g、黄芪20g、当归12g、粳米100g。乌梅、黄芪、当归放砂锅中加水煎开，再用小火慢煎成浓汁，取出药汁后，再加水煎开后取汁，用汁煮粳米成粥，加冰糖趁热食用。具有益气养血脱敏功效，适合过敏体质易发皮肤过敏者食用。 \r\n② 黄芪首乌藤炖猪瘦肉：首乌藤15克，黄芪15克，猪瘦肉100克，食盐、葱、生姜、料酒、味精各适量。首乌藤、黄芪洗净，切片备用；猪瘦肉洗净，切成2厘米见方的块，放人锅内，加灵芝、黄芪、调料、水适量。锅置武火上烧沸，用文火炖熬至瘦猪肉热烂即成。具有益气养血、祛风脱敏功效，适合过敏体质者食用。', 0, 'fab4bfb8765b4c248154d3d658c0393a', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_guide` (`kb_guide_id`, `report_id`, `guide_item_name`, `guide_item_content`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('f81f68eb78464577bbae5bb64f5602gs', '1d9a37a1d9da44a1a648b4fa37d702gs', '饮食保健', '宜选用性平偏温、健脾益气的食物，如大米、小米、南瓜、胡萝卜、山药、大枣、香菇、莲子、白扁豆、黄豆、豆腐、鸡肉、鸡蛋、鹌鹑（蛋）、牛肉等。尽量少吃或不吃空心菜、槟榔、生萝卜等耗气的食物。不宜多食生冷苦寒、辛辣燥热的食物。宜选用性平偏温、健脾益气的食物，如大米、小米、南瓜、胡萝卜、山药、大枣、香菇、莲子、白扁豆、黄豆、豆腐、鸡肉、鸡蛋、鹌鹑（蛋）、牛肉等。尽量少吃或不吃空心菜、槟榔、生萝卜等耗气的食物。不宜多食生冷苦寒、辛辣燥热的食物。宜选用甘温补脾阳、温肾阳为主的食物，如羊肉、鸡肉、带鱼、黄鳝、虾、刀豆、韭菜、茴香、核桃、栗子、腰果、松子、红茶、生姜等。少食生冷、苦寒、黏腻食物，如田螺、螃蟹、海带、紫菜、芹菜、苦瓜、冬瓜、西瓜、香蕉、柿子、甘蔗、梨、绿豆、蚕豆、绿茶、冷冻饮料等。即使在盛夏也不要过食寒凉之品。宜选用甘凉滋润的食物，如鸭肉、猪瘦肉、百合、黑芝麻、蜂蜜、荸荠、鳖、海蜇、海参、甘蔗、银耳、燕窝等。少食温燥、辛辣、香浓的食物，如羊肉、韭菜、茴香、辣椒、葱、蒜、葵花子、酒、咖啡、浓茶，以及荔枝、龙眼、樱桃、杏、大枣、核桃、栗子等。宜选用健脾助运、祛湿化痰的食物，如冬瓜、白萝卜、薏苡仁、赤小豆、荷叶、山楂、生姜、荠菜、紫菜、海带、鲫鱼、鲤鱼、鲈鱼、文蛤等。少食肥、甜、油、黏（腻）的食物。宜选用甘寒或苦寒的清利化湿食物，如绿豆（芽）、绿豆糕、绿茶、芹菜、黄瓜、苦瓜、西瓜、冬瓜、薏苡仁、赤小豆、马齿苋、藕等。少食羊肉、动物内脏等肥厚油腻之品，以及韭菜、生姜、辣椒、胡椒、花椒及火锅、烹炸、烧烤等辛温助热的食物。宜选用具有调畅气血作用的食物，如生山楂、醋、玫瑰花、桃仁（花）、黑豆、油菜等。少食收涩、寒凉、冰冻之物，如乌梅、柿子、石榴、苦瓜、花生米，以及高脂肪、高胆固醇、油腻食物，如蛋黄、虾、猪头肉、猪脑、奶酪等。还可少量饮用葡萄酒、糯米甜酒，有助于促进血液运行，但高血压和冠心病等患者不宜饮用。女性月经期间慎用活血类食物。宜选用具有理气解郁作用的食物，如黄花菜、菊花、玫瑰花、茉莉花、大麦、金橘、柑橘、柚子等。少食收敛酸涩的食物，如石榴、乌梅、青梅、杨梅、草莓、杨桃、酸枣、李子、柠檬、南瓜、泡菜等。饮食宜均衡、粗细搭配适当、荤素配伍合理，宜多食益气固表的食物，尽量少食辛辣、腥发食物，不食含致敏物质的食品，如蚕豆、白扁豆、羊肉、鹅肉、鲤鱼、虾、蟹、茄子、辣椒、浓茶、咖啡等。', 0, 'fab4bfb8765b4c248154d3d658c0393a', '2018-7-6 14:01:28', 2);
INSERT INTO `t_kb_guide` (`kb_guide_id`, `report_id`, `guide_item_name`, `guide_item_content`, `is_valid`, `operate_person`, `operate_time`, `orgid`) VALUES ('fb2eb9939f854354ad3b4286847702gs', '35d069d681e342828ff6f6d2778a02gs', '穴位保健', '气海穴、关元穴  \r\n气海穴：位于下腹部，前正中线上，当脐下1.5寸；\r\n关元穴：位于下腹部，前正中线上，当脐下3寸。\r\n采用掌根揉法，每个穴位按揉2～3分钟，每天操作1～2次。这两个穴位还可以采用艾条温和灸，增加温养益气的作用。温和灸可每周操作1次。关元穴、命门穴\r\n关元穴：参考气虚质。\r\n命门：位于腰部，当后正中线上,第2腰椎棘突下凹陷中。\r\n可采用温和灸的方法，可每周进行1次。 关元穴还可采用掌根揉法。每穴2～3分钟，每天1～2次。也可配合摩擦腰肾法温肾助阳。摩擦腰肾法每天1次，每次约10分钟，以摩至皮肤温热为度。太溪穴、三阴交穴\r\n太溪穴：太溪位于足内侧，内踝后方，当内踝尖与跟腱之间的凹陷处 ；\r\n三阴交穴：位于小腿内侧，当足内踝尖上3寸，胫骨内侧缘后方 ；\r\n可采用指揉的方法，每个穴位按揉2～3分钟，每天操作1～2次。足三里穴、丰隆穴\r\n足三里穴：位置见气虚质；\r\n丰隆穴：位于小腿前外侧，当外踝尖上8寸，条口外，距胫骨前缘二横指处 ；\r\n可采用指揉法，每穴按揉2～3分钟。每天操作1～2次。\r\n支沟穴、阴陵泉穴\r\n支沟穴：位于前臂背侧，当阳池与肘尖的连线上，腕背横纹上3寸，尺骨与桡骨之间；\r\n阴陵泉穴：位于小腿内侧，当胫骨内侧踝后下凹陷处 ；\r\n可采用指揉或拍打的方法，每穴操作2～3分钟，每天1～2次。阴陵泉还可以选择刮痧。期门穴、血海穴\r\n期门穴：位于胸部，当乳头直下，第6肋间隙，前正中线旁开4寸 ；\r\n血海穴：屈膝，在大腿内侧，髌底内侧端上2寸，当股四头肌内侧头的隆起处 ；\r\n采用指揉法。每个穴位操作2～3分钟，每天操作1～2次。合谷穴、太冲穴\r\n合谷穴：位于手背，第1、2掌骨间，当第2掌骨桡侧的中点处 ；\r\n太冲穴：位于足背侧，当第1跖骨间隙的后方凹陷处。\r\n可采用按揉的方法。每穴操作每穴2～3分钟，每天1～2次。神阙穴、曲池穴\r\n神阙穴：位于腹中部，脐中央；\r\n曲池穴：位于肘横纹外侧端，屈肘，当尺泽与在肘横纹外侧端与肱骨外上髁连线中点 ；\r\n神阙采用温和灸，每周1次。曲池采用指揉法，按揉2～3分钟。每天操作1～2次。', 0, 'fab4bfb8765b4c248154d3d658c0393a', '2018-7-6 14:01:28', 2);
